import { combineReducers } from "redux";
import authReducer from "./auth";
import currentUserReducer from "./currentUser";

export default combineReducers({
    authReducer,
    currentUserReducer
})




/*

instead of using :
if-else
       if(actions === "logout")

we use :
Switch case

in reducers > auth.js

*/
